export default function AddCard(props) {
    return <>
    <form>
        <label htmlFor="FirstName">First Name: </label>
        <input type="text" id="FirstName" name="FirstName"/>
        <label htmlFor="LastName">Last Name: </label>
        <input type="text" id="LastName" name="LastName"/>
    </form>
    </>;
}
